(function() {
	var fnTest = /xyz/.test(function () {
		xyz;
	}) ? /\b_super\b/ : /.*/;
	this.Class = function () {};
	this.Class.extend = function (prop) {
		var _super = this.prototype;
		var pty = new this();
		for (var name in prop) {
			if (typeof prop[name] == "function" && typeof _super[name] == "function" && fnTest.test(prop[name])) {
				pty[name] = (function (name, fn) {
					return function () {
						var tmp = this._super;
						// 提供超类的super方法
						this._super = _super[name];
						var ret = fn.apply(this, arguments);
						this._super = tmp;
						return ret;
					};
				})(name, prop[name]);
			} else {
				pty[name] = prop[name];
			}
		}

		function newClass() {
			if (typeof this.ctor == "function") this.ctor.apply(this, arguments);
		}
		newClass.prototype = pty;
		newClass.prototype.constructor = Class;
		newClass.extend = arguments.callee;
		return newClass;
	};
})();
(function () {

	"use strict";

	window.WebApp = Class.extend({
		name: "",
		resources: {},
		htmls: {},
		site: null,
		/**
		 * @param    {object} resources
		 * @p-config {array}  styles
		 * @p-config {array}  scripts
		 * @p-config {object} htmls
		 * @p-config {array}  images
		 * @param    {object} prop
		 */
		ctor: function (resources, prop) {
			for (var name in prop) {
				this[name] = prop[name];
			}

			this.resources = resources;
			this.site = new Site(this.name, this.resources.htmls);
			var self = this;
			setTimeout(function() {
				self.loadResources();
			}, 0);
		},
		/**
		 * 启动函数，其中start()在实例化时需要重写
		 */
		start: function () {
		},
		__start: function () {
			this.start();
			this.start = function () {
			};
		},
		/**
		 * App启动前加载如下资源：
		 * 1.sctyle
		 * 2.script
		 * 3.html
		 * 4.image
		 */
		loadResources: function () {
			var self = this;
			var styles = this.resources.styles;
			var scripts = this.resources.scripts;
			var htmls = this.resources.htmls;
			var images = this.resources.images;
			var total = 0, counter = 0;

			this.onResLoadStart();

			if (styles) total += styles.length;
			if (scripts) total += scripts.length;
			if (htmls) {
				var arr = [];
				for (var name in htmls) {
					arr.push(htmls[name]);
				}
				total += arr.length;
				htmls = arr;
			}
			if (images) total += images.length;

			if (styles && styles.length) new WebApp.StyleLoader(styles, {onUpdate: onUpdate});
			if (scripts && scripts.length) new WebApp.ScriptLoader(scripts, {onUpdate: onUpdate});
			if (htmls && htmls.length) new WebApp.HtmlLoader(htmls, {onUpdate: onUpdate});
			if (images && images.length) new WebApp.HtmlLoader(images, {onUpdate: onUpdate});

			if (!total) this.onResLoadComplete();

			function onUpdate() {
				self.onResLoadUpdate(++counter / total * 100, counter, total);
				if (counter == total) self.onResLoadComplete();
			}
		},
		/**
		 * 开始加载资源
		 */
		onResLoadStart: function () {
			if (this.resources.progress) this.resources.progress.onStart();
		},
		/**
		 * 完成一个资源加载时更新
		 * @param {int|float} percent 百分之X
		 * @param {int}       counter
		 * @param {int}       total
		 */
		onResLoadUpdate: function (percent, counter, total) {
			if (this.resources.progress) this.resources.progress.onUpdate(percent, counter, total);
		},
		/**
		 * 完成所有资源加载时更新
		 */
		onResLoadComplete: function () {
			if (this.resources.progress) this.resources.progress.onComplete();
			this.__start();
		},

		/**
		 * debug模式时输出log
		 */
		debug: false,
		log: function() {
			if (this.debug) console.log.apply(console, arguments);
		}
	});

	var Site = Class.extend({
		name: null,
		view: null,
		Pages: {},
		htmls: {},
		_pages: {},
		/**
		 * @param {string} name
		 * @param {object} htmls
		 */
		ctor: function (name, htmls) {
			this.name = name;
			this.htmls = htmls || {};
			this.view = $("<div id='site_" + name + "'>").appendTo(document.body);
		},
		/**
		 * 返回Site内的Page实例
		 * @param {string} name
		 * @returns {object}
		 */
		getPage: function (name) {
			return this._pages[name];
		},
		/**
		 * 添加Page到Site里，完成后执行回调函数
		 * @param {string}   name
		 * @param {function} callback
		 */
		addPage: function (name, callback) {
			var self = this;
			if (this.getPage(name)) {
				callback && callback(this.getPage(name));
			} else {
				this.__loadPage(name, function (page) {
					self.view.append(page.view);
					page.onAdded();
					callback && callback(page);
				});
			}
		},
		/**
		 * 从Site里移除Page
		 * @param {string} name
		 */
		removePage: function (name) {
			var page = this._pages[name];
			if (page) {
				page.onRemoved();
				page.view.remove();
				delete this._pages[name];
			}
		},
		/**
		 * 加载Page
		 * @param {string}   name
		 * @param {function} callback
		 * @private
		 */
		__loadPage: function (name, callback) {
			var self = this;
			var url = this.htmls[name];
			var page = new WebApp.HtmlLoader(url, function (htmls) {
				var Page = self.Pages[name] || WebApp.Page;
				callback(
					self._pages[name] = new Page(name, $(htmls[url]))
				);
			});
		},
		/**
		 * 注册一个Page类（WebApp.Page的子类）
		 * @param {string} name
		 * @param {object} Page
		 */
		registerPage: function (name, Page) {
			this.Pages[name] = Page;
		}
	});

	WebApp.Page = Class.extend({
		name: null,
		view: null,
		ctor: function (name, view) {
			this.name = name;
			this.view = view;
		},
		onAdded: function () {
			this.initView();
			this.initEvent();
		},
		onRemoved: function () {
		},
		initView: function () {
		},
		initEvent: function () {
		}
	});
})();
/**
 * Progress-进度类
 *
 * 通过本进度的onUpdate、onError和onComplete回调来进行进度显示
 *
 * @author  Rhine.Liu(lyh_0100@sohu.com)
 * @date    2014.11.23
 * @version 1.1.0
 */
(function () {

	"use strict";

	window.WebApp = window.WebApp || {};

	WebApp.Progress = Class.extend({
		/**
		 * 进度开始
		 */
		onStart: function() {},
		/**
		 * 进度更新
		 * @param {int|float} percent 百分之X
		 * @param {int}       counter
		 * @param {int}       total
		 */
		onUpdate: function(percent, counter, total) {},
		/**
		 * 进度中出现错误
		 * @param {string} info 错误信息
		 */
		onError: function(info) {
			window.console && console.log(info);
		},
		/**
		 * 进度完成
		 */
		onComplete: function() {},

		ctor: function(prop) {
			for (var name in prop) {
				this[name] = prop[name];
			}
		}
	});
})();
/**
 * Loader-加载器，包括：
 * 1.图片加载器
 * 2.script(JS)加载器
 * 3.html(DOM)加载器
 * 4.json加载器
 * 5.style(CSS)加载器
 *
 * 异步加载多个文件，提供进度对象的onUpdate、onError和onComplete回调，并可以限制同时加载数
 *
 * @author  Rhine.Liu(lyh_0100@sohu.com)
 * @date    2014.11.21
 * @version 1.4.1
 */
(function () {

	"use strict";

	window.WebApp = window.WebApp || {};

	/**
	 * 加载器父类
	 */
	WebApp.Loader = Class.extend({
		progress: null,
		files: null,
		fileQuantity: 0,
		fileCounter: 0,
		filePos: 0,
		thread: 16,
		threadCounter: 0,
		contents: null,
		prefix: "resource/",

		ctor: function (files) {
			this.contents = {};
			if (files) this.load.apply(this, arguments);
		},
		/**
		 * 加载器接口函数
		 * @param       {array|string}      files
		 * @param       {object|function}   progress
		 * @p-config    {function}          onUpdate
		 * @p-config    {function}          onComplete
		 * @p-config    {function}          onError
		 * @param       {int}               thread
		 */
		load: function (files, progress, thread) {
			if (typeof files == "string") files = [files];
			if (typeof progress == "function") progress = {onComplete: progress};
			this.progress = new WebApp.Progress(progress);
			if (!files || !files.length) {
				progress.onError("no files to load");
				return;
			}
			this.files = files;
			this.fileQuantity = files.length;
			this.thread = thread || this.thread;

			this.loadFiles();
		},

		/**
		 * 加载器内部函数，子类无需重写
		 */
		loadFiles: function () {
			this.progress.onStart();
			for (var i = this.threadCounter; i < this.thread; ++i) {
				var file = this.files[this.filePos++];
				if (!file) break;
				this.loadFile(file);
			}
		},

		/**
		 * 返回前缀URL
		 * @param   {string} url
		 * @returns {string}
		 */
		prefixUrl: function(url) {
			if (!/^http+(s{0,1}):\/\//.test(url) && !/^.{1,2}\//.test(url)) url = this.prefix + url;
			return url;
		},

		/**
		 * 加载器内部函数，子类无需重写
		 */
		onLoad: function () {
			--this.threadCounter;
			++this.fileCounter;
			this.progress.onUpdate(Math.floor(100 * this.fileCounter / this.fileQuantity), this.fileCounter, this.fileQuantity);
			if (this.fileCounter == this.fileQuantity) {
				this.progress.onComplete(this.contents);
			} else {
				this.loadFiles();
			}
		},

		/**
		 * 加载器功能函数，子类需要重写，并要在file加载完成时调用onLoad
		 * @param {string} file
		 */
		loadFile: function (file) {
		},

		/**
		 * 加载一个文件成功时的回调
		 * @param {string} file
		 * @param {all}    response
		 */
		onSuccesss: function (file, response) {
			this.saveFile(file, response);
			this.contents[file] = response;
		},

		/**
		 * 发生错误时的回调
		 * @param {string} file
		 */
		onError: function (file) {
			this.progress.onError("file load with error: " + file);
		},

		/**
		 * 保存内容，子类需要时要重写
		 * @param {string} file
		 * @param {vars}   content
		 */
		saveFile: function (file, content) {
		}
	});

	/**
	 * 图片加载器
	 */
	WebApp.ImageLoader = WebApp.Loader.extend({
		thread: 16,
		loadFile: function (file) {
			this._super(file);
			var self = this;
			var img = new window.Image();
			img.onload = function () {
				self.onSuccesss(file, img);
				self.onLoad();
			};
			img.onerror = function () {
				self.onError(file);
				self.onLoad();
			};
			img.src = this.prefixUrl(url);
		}
	});

	/**
	 * 文本加载器
	 */
	WebApp.TextLoader = WebApp.Loader.extend({
		thread: 16,
		loadFile: function (file) {
			this._super(file);
			var self = this;
			$.ajax({
				url: this.prefixUrl(file),
				async: false,
				contentType: false,
				dataType: "text",
				success: function (text) {
					self.onSuccesss(file, text);
					self.onLoad();
				},
				error: function () {
					self.onError(file);
					self.onLoad();
				}
			});
		}
	});

	/**
	 * html加载器
	 */
	var Htmls = {};
	WebApp.HtmlLoader = WebApp.TextLoader.extend({
		thread: 16,
		loadFile: function (file) {
			if (Htmls[file]) {
				this.contents[file] = Htmls[file];
				this.onLoad();
			} else this._super(file);
		},
		saveFile: function (file, content) {
			Htmls[file] = content;
		}
	});

	/**
	 * script加载器
	 * 加载并执行js文件
	 */
	WebApp.ScriptLoader = WebApp.TextLoader.extend({
		thread: 16,
		onSuccesss: function (file, text) {
			var self = this;
			this._super(file, text);

			try {
				var ret = eval(text);
				this.saveFile(file, text);
				this.contents[file] = ret;
			} catch (e) {
				self.onError(file);
				throw new Error(e);
//				setTimeout(function() {
//					eval(text);
//				}, 0);
			}
		}
	});

	/**
	 * json加载器
	 * 加载并编译json文件
	 */
	var Jsons = {};
	WebApp.JsonLoader = WebApp.TextLoader.extend({
		thread: 16,
		loadFile: function (file) {
			if (Jsons[file]) {
				this.contents[file] = JSON.parse(Jsons[file]);
				this.onLoad();
			} else this._super(file);
		},
		onSuccesss: function (file, text) {
			var self = this;
//			this._super(file, text);

			try {
				var json = JSON.parse(text);
				this.saveFile(file, text);
				this.contents[file] = json;
			} catch (e) {
				self.onError(file);
			}
		},
		saveFile: function (file, content) {
			Jsons[file] = content;
		}
	});

	/**
	 * style加载器
	 */
	WebApp.StyleLoader = WebApp.Loader.extend({
		thread: 16,
		loadFile: function (file) {
			this._super(file);
			var self = this;
			var link = document.createElement("link");
			link.rel = "stylesheet";
			link.rev = "stylesheet";
			link.type = "text/css";
			link.media = "screen";
			link.onload = function () {
				self.onSuccesss(file, link);
				self.onLoad();
			};
			link.onerror = function () {
				self.onError(file);
				self.onLoad();
			};
			link.href = this.prefixUrl(file);
			document.getElementsByTagName("head")[0].appendChild(link);
		}
	});
})();
